import React from "react";
import { NavLink } from "react-router-dom";

const Home = () => {
    return (
        <>
            <section>
                <div className="container-fluid">
                    <div className="row">
                        <div className="col-10 mx-auto"> {/* using 10 columns instead of 12 */}
                            <div className="col-md-6">
                                <h1>Grow your business with <strong>Technical</strong></h1>
                                <h2 className="">We are team of talented developers making websites</h2>
                                <div>
                                    <NavLink className="btn btn" to="/">Get Started</NavLink>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </section>
        </>
    );
};

export default Home;
